import React, { Component } from 'react';

class Category extends Component {
  render() {
    console.log(this.props);
    const { data, active, activeButton } = this.props;
    return active ? (
      <button classList='selected' onClick={activeButton}>
        {data}
      </button>
    ) : (
      <button>{data}</button>
    );
  }
}

export default Category;
